//https://leetcode.com/problems/minimum-cost-to-make-at-least-one-valid-path-in-a-grid
class Solution {
public:
    int minCost(vector<vector<int>>& grid) {
        priority_queue<tuple<int, int, int>, vector<tuple<int, int, int>>, greater<tuple<int, int, int>>> pq;
        pq.push({0, 0, 0});
        int dx[] = {0, 0, 1, -1};
        int dy[] = {1, -1, 0, 0};
        set<pair<int, int>> s;
        while(!pq.empty()){
            auto [cost, x, y] = pq.top();
            pq.pop();
            if(x == grid.size()-1 && y == grid[0].size()-1)
                return cost;
            if(s.count({x,y}))
                continue;
            s.insert({x, y});
            for(int i=0; i<4; i++){
                int r = x + dx[i];
                int c = y + dy[i];
                if(r >= 0 && r < grid.size() && c >= 0 && c < grid[0].size() && !s.count({r, c})){
                    if(grid[x][y] == 1){
                        if(r == x && c == y+1){
                            if(r == grid.size()-1 && c == grid[0].size()-1){
                                return cost;
                            }
                            pq.push({cost, r, c});
                        }else{
                            pq.push({cost+1, r, c});
                        }
                    } else if(grid[x][y] == 2){
                        if(r == x && c == y-1){
                            if(r == grid.size()-1 && c == grid[0].size()-1){
                                return cost;
                            }
                            pq.push({cost, r, c});
                        }else{
                            pq.push({cost+1, r, c});
                        }
                    } else if(grid[x][y] == 3){
                        if(r == x+1 && c == y){
                            if(r == grid.size()-1 && c == grid[0].size()-1){
                                return cost;
                            }
                            pq.push({cost, r, c});
                        }else{
                            pq.push({cost+1, r, c});
                        }
                    } else if(grid[x][y] == 4){
                        if(r == x-1 && c == y){
                            if(r == grid.size()-1 && c == grid[0].size()-1){
                                return cost;
                            }
                            pq.push({cost, r, c});
                        }else{
                            pq.push({cost+1, r, c});
                        }
                    }
                }
            }
        }
        return -1;
    }
};

